import tatiyeNet,{sendInstall}  from "../es6.js"; 

const create= function() {
        let sendFrom=sendInstall({
            "license"    :$('#license').val(),
            "keylicense" :$('#keylicense').val(),
            "driver"     :$('#driver').val(),
            "dbserver"   :$('#dbserver').val(),
            "port"       :$('#port').val(),
            "dbname"     :$('#dbname').val(),
            "user"       :$('#user').val(),
            "password"   :$('#password').val(),
            "form"       :'install'  
       },'Install');

     return sendFrom;
      console.log(sendFrom)

};


const install=document.getElementById('Install');
install.addEventListener('click', create);
